import React from "react";
import { motion } from "framer-motion";
const DashBoard = () => {
  return <>
     <div className="container">
      <motion.p animate={{ x:100 }} className="text-dark display-5"  >  
        
          Welcome to Ghazi Fabric Admin panel
         </motion.p>
     </div>
  </>;
};

export default DashBoard;
